(2, 'eNACH end customer Madate creation link template', 'Dear %%|customername^{\"inputtype\" : \"text\", \"maxlength\" : \"50\"}%%,We have received the request for eNACH Mandate registration for %%|loantype^{\"inputtype\" : \"text\", \"maxlength\" : \"50\"}%% for %%|name^{\"inputtype\" : \"text\", \"maxlength\" : \"50\"}%%.Please click on the link to authorize the eNACH Mandate(link is valid for 15 minutes) http://localhost:81/enach/Customer/CustomerSelf/%%|link^{\"inputtype\" : \"text\", \"maxlength\" : \"30\"}%% _Adarsh Alibag', '1007332839733043468', 'SMS', 1, 'IMPLICIT', 'ADRSHA', 'en', '[\"mandate_customers.customer_name\",\"loan_types.loan_type_name\",\"\",\"mandate_customers.random_code\"]', '', '', 1, '2024-05-17 15:29:08', 'MANDATE_ADD_VERIFICATION', 'Y', 1, 0),
