(9, 'login_verification', 'प्रिय  {{1}},????\r\n\r\nकृपया e-NACH मँडेट पोर्टलवर लॉगिन करण्यासाठी खालील दिलेला OTP टाका.  (OTP 10 मिनिटांसाठी वैध आहे). तुमचा OTP कोणाशीही शेअर करू नका.\r\n\r\n*OTP  :- {{2}}*\r\n\r\nतुम्हाला काही शंका असल्यास खालील नंबर वर कॉल करा ???? किंवा आमच्या वेबसाइट ला भेट द्या.????', '', 'WHATSAPP', 3, '', '', 'mr', '[\"users.firstname\",\"users.otp\"]', '', '', 1, '2024-05-17 16:33:19', 'LOGIN_VERIFICATION', 'Y', 1, 0),
(10, 'mandate_verification', 'प्रिय {{1}},????\r\n\r\nआम्हाला {{2}} साठी रु.{{3}} रकमेच्या e-NACH मँडेट नोंदणीसाठी तुमची विनंती मिळाली आहे.???? कृपया e-NACH मँडेटला अधिकृत करण्यासाठी खालील लिंकवर क्लिक करा.???? (लिंक 15 मिनिटांसाठी वैध आहे).\r\n\r\nअधिकृत लिंक :- {{4}}\r\n\r\nतुम्हाला काही शंका असल्यास खालील नंबर वर कॉल करा ???? किंवा आमच्या वेबसाइट ला भेट द्या.????', '', 'WHATSAPP', 3, '', '', 'mr', '[\"mandate_customers.customer_name\",\"loan_types.loan_type_name\",\"mandate_customers.amount\",\"mandate_customers.transaction_link\"]', '', '', 1, '2024-05-17 16:34:36', 'MANDATE_ADD_VERIFICATION', 'Y', 1, 0),
